import React from "react";
import FrontCard from "./frontcard";

function SignupFront() {
  return(
    <div>
      <FrontCard
      classname = "logcardfront2"
        text1="SIGN UP"
        text2="WITH"
        text3="KHANA SHANA"
        imgpath="./images/Group 10580.svg"
      />
    </div>
  );
}

export default SignupFront;
